import { Box, Button } from "@mui/material"
import './header.css'
import FilterAltIcon from '@mui/icons-material/FilterAlt';
import Select from "react-select";

import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { changeDurationOption, changeOption, changeRecipe, getRecipes } from "../features/recipeSlice";
import { config } from "../App";
const Header=()=>{
  
    const { meal } = useSelector((state) => state.meal);
    const { duration } =useSelector((state)=>state.duration)
    const { recipes } = useSelector((state) => state.recipe);
    const dispatch = useDispatch();
      console.log("m->",meal,"d->",duration)
    let options =[  { value: "breakfast", label: "Breakfast" },
    { value: "lunch", label: "Lunch" },
    { value: "dinner", label: "Dinner" }]
   
    let optionsDuration=[
    { value: "0-30", label: "Within 30 min" },
    { value: "0-60", label: "Within 1 Hour" },
   
]
const getRecipe = async () => {
  let response = {};
  let errored = false;

  try {
    response = await (
      await fetch(`${config.endpoint}/recipe`, {
        method: "GET",
      })
    ).json();
  } catch (e) {
    errored = true;
    return errored;
  }
  
  dispatch(getRecipes(response))
  return recipes
};


    const handleClear =async () => {
        dispatch(changeOption([]))
        await getRecipe()
      };

      const handleClearDuration = async() => {  
        dispatch(changeDurationOption([]))
        if(typeof meal !== 'undefined'){
        if(meal.length ==0){
         return  await getRecipe()
        }
      }
      };
      const performMealFilter = async (e,text) => {
        // console.log("onchange")
        console.log("in perform meal filter")
        dispatch(changeOption(e))
        let response = {};
        let errored = false;
    
        try {
          response = await (
            await fetch(`${config.endpoint}/recipe?meal=${meal.value}`, {
              method: "POST",
            })
          ).json();
        } catch (e) {
          errored = true;
          return errored;
        }   
        // console.log(response)
        dispatch(getRecipes(response));
        // return re;
      };
      const performDurationFilter = async (e,text) => {
        // console.log("onchange")
        dispatch(changeDurationOption(e))
        let response = {};
        let errored = false;
        console.log(meal)
        try {
          response = await (
            await fetch(`${config.endpoint}/recipe?duration=${duration.value}`, {
              method: "POST",
            })
          ).json();
        } catch (e) {
          errored = true;
          return errored;
        }   
        // console.log(response)
        dispatch(getRecipes(response));
        // return re;
      };
      const performSorting = async () => {
        // console.log("onchange")
      
        let response = {};
        let errored = false;
        console.log(meal)
        try {
          response = await (
            await fetch(`${config.endpoint}/recipe?meal=${meal.value}&duration=${duration.value}`, {
              method: "POST",
            })
          ).json();
        } catch (e) {
          errored = true;
          return errored;
        }   
        // console.log(response)
        dispatch(getRecipes(response));
        // return re;
      };
      useEffect(() => {
        if(typeof meal !=='undefined' && typeof duration !== 'undefined'){
        performSorting()
        }
        
      if(typeof meal !=='undefined' && meal.length!==0){
        
        performMealFilter(meal.value)
      }
      if(typeof duration !=='undefined' && duration.length!==0){
        performDurationFilter(duration.value)
      }
      },[meal,duration])
      return(
        <Box>
            <Box className="filter-btn-box">
            {/* <Button className="filter-btn" startIcon={<FilterAltIcon/>} onClick={handleClick}>
                Filter
            </Button> */}
              <div className="filter-bar">
                    <div className="filter-bar-tile">
                        <label htmlFor="duration">Filters:</label>
                    </div>
                    {/* <!-- Duration filter (select one) --> */}
                    <div className="filter-bar-tile">
                       
                              <Select value={meal} options={options} onChange={(e)=> performMealFilter(e,meal)}  placeholder="Meal Type" styles={{menu: provided => ({ ...provided, zIndex: 7 })}}/>

                        <div className="ms-3" style={{color: "#b13d2f", cursor: "pointer"}} onClick={handleClear}>
                            Clear
                        </div>
                    </div>
                    {/* <!-- Category filter (select one or many) --> */}
                    <div className="filter-bar-tile d-flex align-items-center">
                    <Select value={duration} options={optionsDuration} onChange={(e)=>performDurationFilter(e,duration)}  placeholder="Duration" styles={{menu: provided => ({ ...provided, zIndex: 7 })}}/>
                        <div className="ms-3" style={{color: "#b13d2f", cursor: "pointer"}} onClick={handleClearDuration}>
                            Clear
                        </div>
                    </div>
                </div>
                
            </Box>
        </Box>
    )
}
export default Header
